import React from 'react';
import PropTypes from 'prop-types';

const TabItem = (props) => {
         return(
         <li className="tab">
             <div className="position">
                 <a>{props.tab_item_total}77</a>
                 <p>{props.tab_item_title}Total Operation</p>
             </div>
         </li>
         );
}

export default TabItem;
